import { NavLink } from "react-router-dom";

const Nav = () => {
  return (
    <nav className="nav-container">
      <NavLink className="nav-link" to="/">
        Both Sexes study
      </NavLink>
      <NavLink className="nav-link" to="/female">
        Female study
      </NavLink>
      <NavLink className="nav-link" to="/male">
        Male study
      </NavLink>
    </nav>
  );
};
export default Nav;
